import { BrowserRouter } from 'react-router-dom';
import './App.css';
import Navbar from './Components/Navbar/Navbar';
import PokemonList from './Components/PokemonList/PokemonList';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Navbar />
        <PokemonList />
      </div>
    </BrowserRouter>

  );
}

export default App;
